function setBottomProvince(region_url, region_id, city, district,domprovince) {
    var str = '';
    var region_id = region_id || '0';
    var city = city || '0';
    var district = district || '0';
    if (p_objs) {
        for (var vv in p_objs) {
            var selected = (p_objs[vv]['region_id'] == region_id) ? 'selected' : '';
            str += '<option value='+p_objs[vv]['region_id']+' '+selected+'>'+p_objs[vv]['region_name']+'</option>';

        }
        if(!domprovince){domprovince='#Bottom_province';}
        $(domprovince).append(str);
    } else {
       // alert('nooo1');
    }

    if (city == '0') {
        setBottomCity(region_url, $(domprovince).find("option:eq(0)").val());
    }
}
function setBottomCity(region_url, region_id, city, district,domcity) {
    var region_id = region_id || '0';
    var city = city || '0';
    var district = district || '0';
    var str = '';
    if(!domcity){domcity='#Bottom_city';}
    $(domcity).html('');
    if (c_objs) {
        for (var cc in c_objs) {
            if (c_objs[cc]['parent_id'] == region_id) {
                var selected = '';
                str += '<option value='+c_objs[cc]['region_id']+' '+selected+'>'+c_objs[cc]['region_name']+'</option>';

            }
        }
        //console.log(str);
        $(domcity).append(str);
    } else {
       // alert('nooo2');
    }
    if (district == '0') {
        setBottomDistrict(region_url, $(domcity).find("option:eq(0)").val(),'');
    }
}
function setBottomDistrict(region_url, region_id, district,domdistrict) {
    var str = '';
    if(!domdistrict){domdistrict='#Bottom_district';}
    $(domdistrict).html('');
    if (d_objs) {
        for (var dd in d_objs) {
            if (d_objs[dd]['parent_id'] == region_id) {
                var selected = '';
                str += '<option value='+d_objs[dd]['region_id']+' '+selected+'>'+d_objs[dd]['region_name']+'</option>';

            }
        }
        $(domdistrict).append(str);
    } else {
      //  alert('nooo3');
    }
}


